import sys
from PyLock import *

script = "locker = PyLock('')\nlocker.unlock(XorLock, 'thi')"

while True:
	lines = script.split('\n')
	b64 = None
	xor_key = None
	
	for line in lines:
		if "PyLock" not in line and "XorLock" not in line:
			continue
			
		line = line.strip()

		if "PyLock" in line:
			b64 = line.replace("locker = PyLock('", '').replace("')", '')
			
		if "XorLock" in line:
			xor_key = line.replace("locker.unlock(XorLock, '", '').replace("')", '')
			
	if b64 is None or xor_key is None:
		print(script)
		break
			
	locker = PyLock(b64)
	locker.unlock(XorLock, xor_key)
	script = locker.script
			